import React from 'react';
import logo from './logo.svg';
import PlotRoute from './components/PlotRoute.js';
import { VictoryChart, VictoryVoronoiContainer, VictoryGroup, VictoryTooltip, VictoryLine, VictoryScatter, VictoryAxis, VictoryTheme } from 'victory';
import './App.css';

const data = [
  { x: 0, y: 0 },
  { x: 1, y: 0 },
  { x: 2, y: 0 },
  { x: 2, y: 1 },
  { x: 2, y: 2 },
  { x: 2, y: 3 },
  { x: 1, y: 3 }
];

const strokeDasharray = "10, 5";

class App extends React.Component {

  render() {
    return (
      <VictoryChart height={200} width={200} containerComponent={<VictoryVoronoiContainer/>}>
        <VictoryAxis crossAxis
          width={200}
          height={200}
          domain={[-10, 10]}
          theme={VictoryTheme.material}
          offsetY={100}
          standalone={false}
          style={{
            grid: {stroke: "#ECEFF1", strokeDasharray},
            ticks: {stroke: "grey", size: 1},
            tickLabels: {fontSize: 3, padding: 1}
          }}
        />
        <VictoryAxis dependentAxis crossAxis
          width={200}
          height={200}
          domain={[-10, 10]}
          theme={VictoryTheme.material}
          offsetX={100}
          standalone={false}
          style={{
            grid: {stroke: "#ECEFF1", strokeDasharray},
            ticks: {stroke: "grey", size: 1},
            tickLabels: {fontSize: 3, padding: 1}
          }}
        />
        <VictoryGroup
          color="#c43a31"
          labels={({ datum }) => `x: ${datum.x} y: ${datum.y}`}
          labelComponent={
            <VictoryTooltip style={{ fontSize: 4 }} flyoutStyle={{ stroke: "tomato", strokeWidth: 2 }} />
          }
          data={data}
        >
          <VictoryLine style={{parent: { border: "1px solid #ccc"}}}/>
          <VictoryScatter size={({ active }) => active ? 2 : 1}/>
        </VictoryGroup>
      </VictoryChart>
    );
  }
}

export default App;
